title:
@柒鹅！ 此人2022年12月中开了个40的小团，开团时说最快1个月内发货，结果拖到今年4月才收到货，延期也没任何公告，从2月问到4月有没有具体发货时间，期间不是说下个月发就是在打包或者过两天发，要么就是叫了快递来取件，终于在4月13号发货了，到手发现少配件和外壳有问题，就是拖着不回复，键盘问题也是问了不知道在联系原作者，然后就不了了之
这中间各种私聊群内艾特他，基本都啊要过几天才回复一下
最奇怪是这群差不多有70人买了（石墨看的不知道准不准），但是就没看到有人晒过成品

@夜绥Sakura，请观赏键圈对你的态度。
截图来自键圈观察小队二号观察员（Helix分部）
你在键圈赚钱上是成功的，但论品行和言辞不敢苟同
